import React from 'react';
import './roles.css';
import { render } from '@testing-library/react';

function Roles() {
    return (
        <div className="homeContainer">
            <div className="tableRoles col-md-9">
                <div className="col-md-12">usuarios existentes</div>
                <div className="col-md-12">tabla</div>
            </div>
            <div className="filterMenuRoles col-md-3">
                <div className="">filtrar</div>
            </div>
        </div>
    )
}

export default Roles;
